  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is one component of a digital
  orthophoto coverage (DOI) over the Southwest Florida Water Management District (SWFWMD
  contract B089 Winterhaven, Fl) area. This dataset is comprised of 4-band stack 32bit
  (red, green, blue and infrared bands) DOI cells in a Geotiff format, at a 1-foot
  pixel resolution, based on the District's 5,000' x 5,000' tile system. This dataset
  was created from source imagery acquired through the Leica ADS40 multispectral scanner
  from December 22, 2009 through January 06, 2010. The companion dataset to this coverage
  includes a dataset comprised of the original imagery mosaic lines with dates of
  imagery acquisition in the ESRI file geodatabase feature class.\",\n\t\"owner_org\":
